std::complex<double> DT::A1A1BbTree(const double &cos_t, const double &s)
{
    std::complex<double> MHSqcomp = std::complex<double>(MH*MH,-MH*WH);
    std::complex<double> MS1Sqcomp = std::complex<double>(MS1*MS1,-MS1*WS1);

    return -((sqrt(2.)*(MHSqcomp - MS1Sqcomp)*s*token15*token2*token39*(token11 + token9)*(s - 4.* (MB*MB)))/((MHSqcomp - s)*(-MS1Sqcomp + s)*token28));
}

std::complex<double> DT::A1A1BbTreeConj(const double &cos_t, const double &s)
{
    std::complex<double> MHSqcomp = std::complex<double>(MH*MH,-MH*WH);
    std::complex<double> MS1Sqcomp = std::complex<double>(MS1*MS1,-MS1*WS1);

    return std::conj(-((sqrt(2.)*(MHSqcomp - MS1Sqcomp)*s*token15*token2*token39*(token11 + token9))/(2.*(MHSqcomp - s)*(-MS1Sqcomp + s)*token28)));
}

